import React, {useState} from 'react';
import Session from './Session';

const SessionList = () => {

    const [sessions, setSessions] = useState([
        {
            id: 223131,
            name: "Session 1",
            isPrivate: true
        },
        {
            id: 3231231,
            name: "Session 2",
            isPrivate: true
        },
        {
            id: 22331231,
            name: "Session 3",
            isPrivate: false
        }

    ]);

    return ( 
        <div>

        { sessions.map(session => (
            <Session name={session.name} key={session.id}/>
        )) }

        </div>

    );
}

export default SessionList;
